import './App.css';
import React from 'react'; 
import Navbar from './components/Navbar/Navbar';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './pages/Shop';
import ShopCategory from './pages/ShopCategory';
import Recipe from './pages/Recipe';
import LoginSignUp from './pages/LoginSignUp';
import Footer from './components/Footer/Footer';
import valorant_banner from './components/assets/velikonocni-cupcaky.jpg'
import sapnap_banner from './components/assets/velikonocni-cupcaky.jpg'
import random_banner from './components/assets/aperol.jpg'

function App() {
  return (
    <div>
      <BrowserRouter>
      <Navbar/>
      <Routes>
        <Route path='/' element={<Home/>}/>
        <Route path='/sladke' element={<ShopCategory banner={valorant_banner} category="Sladké"/>}/>
        <Route path='/sapnap' element={<ShopCategory banner={sapnap_banner} category="Předkrmy"/>}/>
        <Route path='/napoje' element={<ShopCategory banner={random_banner} category="Nápoje"/>}/>
        <Route path='/polevky' element={<ShopCategory banner={random_banner} category="Polévky"/>}/>
        <Route path='/hlavni-chody' element={<ShopCategory banner={random_banner} category="Hlavní chody"/>}/>
        <Route path='/salaty' element={<ShopCategory banner={random_banner} category="Saláty"/>}/>
        <Route path='/recipe' element={<Recipe/>}>
          <Route path=':recipeId' element={<Recipe/>}/>
        </Route>
        <Route path='/login' element={<LoginSignUp/>}/>
        <Route path='/' element={<Home/>}/>
      </Routes>
      <Footer/>
      </BrowserRouter>
    </div>
  );
}

export default App;
